description:
Director: George Lucas

Writer: George Lucas (written by)

Release Date: 19 May 1999 (USA)

Every generation has a legend. Every journey has a first step. Every saga has a beginning.

As imminent conflict brews between the powerful Trade Federation and the peaceful planet of Naboo, Jedi Master Qui-Gon Jinn and his apprentice Obi-Wan Kenobi travel to Naboo to warn the Queen of the galactic fallout which is to follow. Eventually, Naboo is invaded forcing the Jedis to evacuate the planet with the Queen and her court. They travel to the desert planet of Tatooine where they meet a slave boy called Anakin Skywalker who is evidently one with the Force. They enlist his help in fighting the war, while the Jedis confront one of the Dark Jedis behind the invasion, Darth Maul, while his master Darth Sidious continues to lead the invasion as a &quot;phantom&quot; behind the scenes.

Res: 1920 X 820 23fps


